    n, m = map(int, input().split())
    teleports = []
    for i in range(m):
        a, b, t = map(int, input().split())
        teleports.append((a, b, t))
    teleports.sort(key=lambda x: x[2])
    dragonballs = list(map(int, input().split()))
    visited = [False] * n
    visited[0] = True
    queue = [(0, 0)]
    while queue:
        city, coins = queue.pop(0)
        for a, b, t in teleports:
            if a == city and not visited[b]:
                if b in dragonballs:
                    dragonballs.remove(b)
                    if not dragonballs:
                        return coins + t
                else:
                    queue.append((b, coins + t))
                    visited[b] = True
            elif b == city and not visited[a]:
                if a in dragonballs:
                    dragonballs.remove(a)
                    if not dragonballs:
                        return coins + t
                else:
                    queue.append((a, coins + t))
                    visited[a] = True
    return -1

